script: |
  super -f tsv -I q7445.sql | sort > q7445.out

vector: true

inputs:
  - name: q7445.sql
    data: |
      SELECT ALL * FROM tab2 AS cor0 WHERE CAST ( - - col1 AS INTEGER ) / - col2 + - 76 NOT BETWEEN ( - CAST ( - ( - col0 ) AS INTEGER ) ) + col0 AND + col2 * - 7;
  - name: tab2

outputs:
  - name: q7445.out
    data: |
      46	51	23
      64	77	40
      75	67	58
